import './App.css';
import Login from './components/Login';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Redirect
} from "react-router-dom";
import { useState } from 'react';


const [isAuth, setIsAuth] = useState(true)


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/login" element={() => isAuth ? <Login/> : <h1>Not auth</h1>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
